import { GEO_API, GEO_API_URL } from "./API";

const Test = () => {
  const fetchJoke = async () => {
    const url =
      "https://wft-geo-db.p.rapidapi.com/v1/geo/places/%7BplaceId%7D/time";
    const options = {
      method: "GET",
      headers: {
        "x-rapidapi-key": "bb22ca9c50msh93d865682457e2ep110ff6jsn85c06eedd124",
        "x-rapidapi-host": "wft-geo-db.p.rapidapi.com",
      },
    };

    try {
      const response = await fetch(url, options);
      const result = await response.text();
      console.log(result);
    } catch (error) {
      console.error(error);
    }
  };
  return (
    <div>
      <h1>Hello</h1>
      <button onClick={fetchJoke}></button>
    </div>
  );
};
export default Test;
